location: &quot;006&quot;,
total_items: 76,
__v: 0
}]
</code></pre>
<p>For example, from the dairy group I need to return a json with the following structure.</p>
<pre><code>{
  'id': null,
  'group': 'dairy',
  'INITIATED': 3,
